INSERT INTO `dbnoticias` (`IdNoticia`, `Titulo`, `Imagen`, `Parrafo`, `FechaCreacion`) VALUES
(9, 'En Caso de Lluvia que Deben hacer', '', 'Importante: en caso de lluvia comunicarse con la organizacion el sabado despues de las 11hs a los tel que figuran en la pagina y ahi se le informara si se juega o no la fecha, una cosa muy importante no se responden mensajes de texto solamente las llamadas ya que son demasiados los equipos que juegan y se nos hace imposible contestar todos los mensajes', '2013-04-26 23:03:08'),
(10, 'Puntuacion Tabla de Conducta', '', 'Para reducir el juego brusco y la mala conducta tanto dentro de la cancha, como fuera de ella, se pondra en funcionamiento la tabla de conducta, cuyo sistema de sancion y acumulacion de puntos sera : \r\n *1 punto por amarilla, 3 puntos por expulsion, 8 puntos por jugador expulsado del torneo, 10 puntos por falta del equipo sin aviso, 3 puntos por falta del equipo con aviso y 5 puntos por fecha para el equipo que mantenga deudas con la organizacion. El limite acumulativo  será de 50 puntos, quien llegue a esta suma quedara automaticamente fuera del torneo. Quien acumule menos puntos se hara acreedor al premio fairplay\r\n', '2013-04-26 23:04:00'),
(11, 'Es Obligatorio el uso de canilleras', '', 'A partir de Marzo del 2o13, la falta o ausencia de canilleras en la indumentaria del jugador antes del inicio del cotejo, tendrá la siguiente resolución (solo para torneos en el predio SHOWBOL):\r\n El jugador en cuestión será sancionado automaticamente de "oficio" por medio de una Amonestación, sin esgrimir la tarjeta Amarilla por parte del árbitro del cotejo (como se procedía anteriormente);ya que en éste caso, y a partir de ahora, dicha sanción/amonestación no tendrá incidencia disciplinaria en el juego. Se le informará a los capitanes, quienes deberán estar debidamente identificados, los jugadores sancionados por dicha infracción.\r\n El jugador "Amonestado/sancionado de oficio" NO INICIA EL PARTIDO CON UNA AMONESTACIÓN (Tarjeta Amarilla), sino que su sanción (Amonestación) por falta de canilleras, le será contabilizada en la acumulación personal de Tarjetas Amarillas y en lo grupal (equipo) en la tabla de Fair Play.\r\n Una vez iniciado el cotejo, los jugadores quedarán sujetos a los procedimientos y sanciones según reglamento gral de AFA \r\n\r\n', '2013-04-26 23:04:31'),
(12, 'Prohibido marcas linea de cal por los arqueros', '', 'Esta terminantemente prohibido que los arqueros realicen en la linea de cal marcas con los botines delimitando la altura del medio del arco y los palos de los costados, el arbitro que observa que el arquero este realizando esto seran sancionado con una amarilla como lo dice el reglamento de AFA  ', '2013-04-26 23:05:36'),
(63, 'Puntos a Tener en cta', '', 'Puntos a tener en cta para el nuevo torneo que comienza el sabado 8 de MARZO: Equipo que falta a jugar sin previo aviso a la organizaci?n, queda automaticamente fuera del torneo. -Equipo que implementa juego brusco grave, insitaci?n a pelear o genere cualquier desman dentro o fuera de la cancha queda automaticamente fuera del torneo. <br>\r\n-El arbitro es el que imparte justicia fuera y dentro de la cancha, cualquier informe redactado por ?l ser? comunicado ...al equipo correspondiente.<br>\r\n-Queda totalmente prohibido increpar o venir a protestar a la mesa de planilla tanto al referato como al planillero por alguna causa que fuese del juego.Toda consulta efectuada de forma formal ser? bienvenida de lo contrario el equipo ser? informado y sancionado con quita de puntos.<br>\r\n-Las personas que estan fuera de la cancha ( que vienen a acompa?ar al equipo) tienen que estar atras del hilo.Todo equipo que lleve personas que acompa?en tendr?n responsabilidad absoluta sobre ellos,ya sea por generar alg?n altercado con el equipo rival,la gente que esta afuera ,el arbitro o cualquier miembro que este circulando por el predio. -<br>\r\nDejar sus pertenencias en el auto o dentro de las redes de los arcos (la primera opcion es la mas deseada por si hay algun objeto de valor que se pueda romper con un simple pelotazo). -', '2014-03-09 16:50:15'),
(67, 'Pedido de horarios', '', 'Se?ores Delegados de Equipos y Participantes, a partir de la fecha le pedimos por favor que no pidan jugar en algun horario especial los dias sabados ya que es imposible acomodar los horarios a 120 equipos, desde el momento que asumen la responsabilidad de jugar el torneo, se les informan cuales son los horarios de los partidos y uds como equipo aceptan las condiciones, por eso a partir de ahora no pidan horarios y acepten el horario que les toque jugar, aquellos que no esten de acuerdo con esta medida estan en todo su derecho de retirarse del torneo, de esta manera no perjudicara al equipo que acepta las condiciones del torneo y cumple sabado tras sabado.', '2014-03-18 19:32:39'),
(23, 'ESTACIONAMIENTO', '', ' Le pedimos que estacionen los autos en los lugares correcto y utilicen todo el espacio que le brindamos en el predio ya que muchas veces llegan tarde dejan el auto en cualquier lado y dificulta aquel que quiera estacionar o salir del predio.', '2013-05-27 15:42:26'),
(24, 'Buscanos en Facebook', '', 'torneofutbol showbol', '2013-06-01 20:07:46'),
(29, 'Medidas drasticas', '', 'A partir del sabado proximo solamente podran ingresar al predio jugadores y delegados, el publico que viene a ver a distintos equipos no podran ingresar al predio, se que con esta medida se ven perjudicados algunos pocos que van a distenderse y ver a sus hijos, amigos o familiares como juegan al futbol, pero hemos notado que en los ultimos sabados, muchos echos de violencia se produjeron por la gente que viene de espectadores.\r\nTambien tome la decision por lo que vengo notando los ultimos sabados de dejar equipos afuera para el prox torneo que comienza el martes 9 de julio, el prox sabado le informare a los mismos equipos en forma personal que no tienen mas lugar en el torneo.', '2013-07-01 12:29:31'),
(87, 'Tabla de Conducta', '', 'Recuerden que en la tabla de conducta solo pueden sumar 50pts una vez pasado esa cantidad de pts el equipo es expulsado automaticamente del torneo.', '2014-08-13 18:49:52'),
(93, 'Nuevos Horarios', '', 'A Partir de este sabado los horarios seran los siguientes:\r\n13hs: citacion de equipos \r\n13:15hs empieza a correr el reloj del arbitro.\r\n14:15hs citacion de equipos\r\n14:30hs empieza a correr el reloj del arbitro\r\n15:30hs citacion de equipos \r\n15:45hs empieza a correr el reloj del arbitro\r\n16:45hs citacion de equipos\r\n17:hs empieza a correr el reloj del arbitro\r\n\r\nSeamos puntuales con los horarios traten de llegar en el horario de citacion asi pueden llenar tranquilo la planilla y pueden jugar el tiempo de juego que corresponde<br><br><br><br><br>', '2014-10-23 10:52:26'),
(102, 'Vacantes disponibles ', '', 'Vacantes disponible para ingresar al torneo equipos interesados enviar msj privado o comunicarse al 155015574<br>', '2014-11-28 11:36:14'),
(105, 'Inscripcion Torneo 2015', '', 'Se encuentra abierta la inscripcion para el torneo que comienza a mediados de Febrero del 2015, aquellos equipos interesados deberan comunicarse al 155015574 o enviar un mail a torneofutbol9sc@hotmail.com.', '2014-12-15 09:02:04'),
(109, 'Reinicio Torneo 2015', '', 'Equipos le recordamos que el reinicio del torneo sera el sabado 21 de Febrero aquellos equipos que ya estaban jugando el torneo estaria bueno que vayan avisando si continuan o no en el mismo, ya que paso mucho tiempo desde que termino y estaria bueno ir sabiendo que va hacer cada equipo.\r\nLes queremos contar que estamos haciendo trabajos de mejoramiento en todas las areas de las canchas con semillas fertilizantes y arena y las canchas de la 13 a la 16 se han reseembrado, emparejado con tierra y arena y se fertilizaron.', '2015-01-26 21:39:41');
