(1, 'Fecha 1', '<h5>Victoria Naranja</h5>\n<h6>Por Gonzalo Rossi.</h6>\n <p>En la tarde agradable del sábado, y por una nueva fecha del campeonato Showbol, El Perejil le gano por la mínima diferencia a La Vuelta. Las primeras acciones del pleito fueron a su favor del equipo naranja. Primero lo tuvo con tirolibre de Andrés Schneider, que fue atajado por Javier Duarte, y luego con disparos de Nicolás Gómez, nuevamente del nueve y de Fabrizio Russo. En cambio, por el otro carril, La vuelta, que actuó de azul, intento llegar al arco defendido por Julio Martínez, por medio de un cabezazo que de Víctor Toledo, que paso cerca del palo. Luego de sufrir esta jugada, El Perejil respondió y fue letal, porque Gómez saco un gran disparo y abrió el marcador. Con este gol, se fue el primer tiempo.\n Los segundos treinta minutos fueron chatos, con escasas chances de gol. Lo que se pudo destacar fue un disparo de Eduardo Woites, que fue atajado por Martínez y un remate de Pablo Díaz, que también fue contenido por el uno anaranjado. Por otra parte, El Perejil no tuvo grandes chances de liquidar el partido, pero Schneider se las ingenio para complicar a la defensa azulada.\n El Perejil gano con lo justo, golpeó cuando tuvo que hacerlo y luego se dedico a aguantar el pleito porque contaba con un hombre menos (expulsado por doble amarilla Leonardo Gioiosa). En cambio, La Vuelta nunca le encontró, precisamente, la vuelta a el partido y le falto push en el ataque, pero es un buen equipo y buscara tener mejor suerte el fin de semana que viene.</p>\n \n<h5>Reparto verde </h5>\n<h6>Por Gonzalo Rossi.</h6>\n <p>Por una nueva fecha del Torneo Schowbol, que se lleva a cabo en nuestra Ciudad, en la Cancha Numero Uno, No me la expliques y Cayili no se sacaron ventajas y empataron dos a dos.\n Las primeras acciones del match fueron para el equipo verde, primero con un cabezazo que se fue cerca de Juan Griniori, y luego con un remate con pifia incluido de Martin Almirón. Por el otro lado, el conjunto también conformado con verde, pero acompañado con blanco, intento hacer vibrar las gargantas a través de un disparo desviado de Nicolás Sorgi y un tiro de Fernando Moll que paso cerca del poste. Pero esto no fue todo para el equipo que antes conducía antes el arquero de Estudiantes, Gerónimo Rulli. Porque después de que perder otra chance mas a manos de Lucas Savino, el ocho se tomo revancha, y con un remate sutil, abrió el marcador. Pero el que golpeó antes de que finalice el primer tiempo fue No me la expliques, que con un cabezazo de Juan Griniori, pudo haber puesto el encuentro empatado, pero la bola fue controlada sin problemas por Lucas Falchi.\n La segunda etapa arranco con un gol bajo el brazo, porque Diego Lentini entro al área rival, y con un gran remate, aumento el marcador para Cayili. Con 0-2 en contra, No me la expliques no se resigno y fue por el descuento, para después soñar con el empate. Pudo haber marcador con una mediavuelta de Digdanian, pero el balón se fue afuera. Esto genero que Cayili fuera en busca de liquidar el pleito con un tiro de Moll, pero el uno, Pablo Artullo, mantuvo la ilusión para el verde y se quedo con la pelota entre sus manos.\n Un poco mas aliviado, No me la expliques intento llegar al arco defendido por Falchi por medio Martin Almirón y Digdanian, pero la puntería les jugo una mala pasada. Pero de tanto insistir, el verde pudo poner el pleito 1-2 gracias a su nueve, que esta vez pudo sacarse la mufa. E instantes después, apareció de nueve el delantero, que con un remate y con una floja respuesta de Falchi, sentencio la igualdad final.</p>\n \n<h5>Goleada del LHFC</h5>\n<h6>Por Gonzalo Rossi</h6>\n<p>Uno de los últimos partidos de la jornada del sábado la jugaron Juppon Gatana y LHFC, encuentro que fue ganado por el equipo de Los Hornos por goleada.\n El primero en golpear fue el conjunto rojo y negro con un cabezazo de Leonel Castillo, que paso cerca del palo de Marcelo Burriel. En cambio, por el lado del equipo rojo y amarillo, lo tuvo a través de un disparo que se fue por arriba de Martin Gómez. Pero el que si pudo abrir el marcador fue Cristian Cendoyo. \nCon el resultado en contra, Juppon intento llegar al empate por medio de un remate de Gómez, que fue controlado por el uno, y con una mediavuelta desviada de Nicolás Fazio.\n El segundo tiempo arranco con un gol bajo el brazo, porque Maximiliano Antonelli saco un destacado remate y aumento el tanteador para LHFC. Esto no fue todo, porque el elenco rojonegro fue por más. Lo tuvo Castillo con un tirolibre, pero Burriel se quedo con el balón en su poder. Después pudo haber mojado Emiliano Cuello, también con una pelota parada, pero otra vez el uno rojoamarillo contuvo la bola. Pero de tanto insistir, Pablo Locatelli afino su botín y aumento la ventaja, como también lo hizo luego Matías Lugo. \nLHFC fue muy efectivo con las oportunidades que tuvo para marcar, teniendo a sus delanteros muy picantes y a sus defensores muy sólidos. En cambio, Juppon le falto puntería y eficacia a la hora de atacar, y solidez a la hora de defender, pero seguro en la semana va a corregir estos errores y buscara tener revancha el sábado que viene.</p>\n \n<h5>Se unieron y triunfaron</h5>\n<h6>Por Gonzalo Rosi.</h6>\n<p>Sorpresivamente, en la jornada del sábado, perdió uno de los campeones el torneo Schowbol, Tornado, perdió dos a cero con Los Hermanos.\n Instantes después de que comenzara el pleito, el equipo azul abrió el marcador gracias a Cristian Núñez, y luego el partido pudo haberse puesto 2-0, porque Osvaldo Ponce, en su esfuerzo por rechazar un centro, casi vence a su propio arquero. Por el otro lado, el conjunto rojo intento llegar al empate, pero Los Hermanos estuvo muy bien firme, tanto en el mediocampo como en la defensa, y eso genero que la joya que tiene el elenco colorado, Cesar Lezcano, prácticamente, no pudiera ser de las suyas. Así se fue la primera parte, con el azulado ganando bien y con el campeón sin poder encontrarle la vuelta al resultado.\n En la segunda, Tornado pudo haber empatado el match, pero el disparo de Lezcano se fue por arriba del travesaño. Luego de esta chance, el que si afino el botín y liquido el juego fue, otra vez, Núñez. El Rojo busco llegar al descuento, con más corazón que ideas, por medio de un cabezazo y un disparo de Juan Gayoso, pero esta vez, la puntería no estuvo del lado de los Lezcano e Ibarra.\n Los Hermano gano bien, porque supo como jugarle a uno de los equipos que siempre pelea los primeros puestos. En cambio, Tornado buscara ajustar los errores en la semana y tener revancha la fecha que viene.</p>'),
