(1, '<h3>Zona A</h3>\n\n<p><strong>Primer puesto:</strong> un juego de camiseta a elección(10) + 10 pantalones, un trofeo para el equipo , tiene bonificado la inscripción del próximo campeonato.</p>\n<p><strong>Segundo puesto:</strong>  un juego de camisetas (10)y un trofeo para el equipo.</p>\n<p><strong>Tercer puesto:</strong> un trofeo para el equipo y una promo fiesta.</p>\n\n \n<h3>Zona B</h3>\n\n<p><strong>Primer puesto:</strong> un juego de camiseta(10) + 10 pantalones y un trofeo para el equipo, tiene bonificada la inscripción para el próximo torneo.</p>\n<p><strong>Segundo puesto:</strong>  un juego de camisetas (10) y un trofeo para el equipo.</p>\n<p><strong>Tercer puesto:</strong> un trofeo para el equipo y una promo fiesta.</p>\n\n\n<h3>Zona C</h3>\n\n<p><strong>Primer puesto:</strong> un juego de camiseta a elección(10) un trofeo para el equipo y tiene bonificada la inscripción para próximo torneo.</p>\n<p><strong>Segundo puesto:</strong>  un juego de camisetas(10) y un trofeo para el equipo.</p>\n<p><strong>Tercer puesto:</strong>  un trofeo para el equipo y una promo fiesta.</p>\n\n \n<h3>Zona D</h3>\n\n<p><strong>Primer puesto:</strong> un juego de camiseta a elección (10)  un trofeo para el equipo y tiene bonificada la inscripción  próximo torneo.</p>\n<p><strong>Segundo puesto:</strong>  un juego de camisetas y un trofeo para el equipo.</p>\n<p><strong>Tercer puesto:</strong>un trofeo para el equipo y una promo fiesta.</p>\n\n<h3>Zona E</h3>\n\n<p><strong>Primer puesto:</strong> un juego de camiseta(10) y un trofeo para el equipo.</p>\n<p><strong>Segundo puesto:</strong>  una promo fiesta y un trofeo para el equipo.</p>\n\n<h3>Zona F</h3>\n\n<p><strong>Primer puesto:</strong>Primer puesto: un juego de camiseta(10) y un trofeo para el equipo \n\n\n<p><strong>Segundo puesto:</strong>Segundo puesto:  una promo fiesta y un trofeo para el equipo.</p> \n\n  \n\n <p><strong>Tercer puesto:un trofeo para el equipo \nNuevo.</p>\n\n<h3>Zona G</h3>\n\n<p><strong>Primer puesto:</strong>nuevo.</p>\n\n\n\n<p><strong>Primer puesto:</strong>Nuevo.</p>\n\n\n\n<p><strong>Primer puesto:</strong>Nuevo.</p>\n\n<h3>Zona H</h3>\n\n<p><strong>Primer puesto:</strong>nuevo.</p>\n\n\n\n<p><strong>Primer puesto:</strong>Nuevo.</p>\n\n\n\n<p><strong>Primer puesto:</strong>Nuevo.</p>\n\n<br />\n\n<h4>Goleador: el goleador de cada zona tendrá una copa de premio y el goleador de la tabla general de todo el torneo obtendrá aparte de  la copa un par de Botines de primera marca.</h4>\n\n<blockquote>Valla Menos Vencida: el arquero menos vencido del torneo obtendrá un par de guantes. </blockquote>', '2013-10-01');
