sión Organizadora y/o Complejo Deportivo.</p>\n\n<p><strong>Articulo 19:</strong> Los organizadores junto con el Complejo Deportivo estarán facultades con el derecho de admisión de ingreso de equipos y/o jugadores al torneo.</p>\n\n<p><strong>Articulo 20:</strong> Este código será de aplicación obligatoria para los que directa o indirectamente integren el Torneo Jugadores, delegados, D.T., árbitros, Organizador, Complejo Deportivo, etc.).</p>\n\n<p><strong>Articulo 21:</strong> Cada equipo completara en la planilla antes del inicio de cada encuentro Nombre y Apellido, D.N.I., nro de camiseta para control, anotación de los goleadores, etc y deberan abonar la suma de $ p de no ser asi el equipo perdera automáticamente los puntos.</p>\n\n<p><strong>Articulo 22:</strong> La Organización se reserva el derecho de expulsar a un equipo por mal comportamiento, tanto dentro como fuera del campo de juego.</p>\n\n<p><strong>Articulo 23:</strong> Los Partidos se desarrollaran en dos tiempos de 30 minutos cada uno, sumado a lo que adicione el arbitro  y se jugara con un solo Futbol.</p>\n\n<p><strong>Articulo 24:</strong> Los equipos que no den aviso a la concurrencia de su partido perderan el deposito que equivale al valor de un partido, el mismo lo iran pagando en el transcurso de las fechas. </p>\n\n<p><strong>Articulo 25:</strong> El torneo se desarrollara de la siguiente manera por zonas de ascenso y descenso, o sea los equipos que continuen en nuestro torneo permaneceran en sus respectivas zonas en caso que halla equipos que abandonen el torneo automáticamente  ascenderan de zona, caso contrario los equipos nuevos ingresaran en la ultima zona y tendran que ir ascendiendo.En sistema es ascienden los primeros 3 de cada zona y descienden los ultimos 3.</p> \n\n \n\n \n\n<p><strong>Articulo 26:</strong>  A partir de Febrero del 2o11, la falta o ausencia de canilleras en la indumentaria del jugador antes del inicio del cotejo, tendrá la siguiente resolución (solo para torneos en el predio SHOWBOL):</p>\n<p>El jugador en cuestión será sancionado automaticamente de "oficio" por medio de una Amonestación, sin esgrimir la tarjeta Amarilla por parte del árbitro del cotejo (como se procedía anteriormente);ya que en éste caso, y a partir de ahora, dicha sanción/amonestación no tendrá incidencia disciplinaria en el juego. Se le informará a los capitanes, quienes deberán estar debidamente identificados, los jugadores sancionados por dicha infracción.</p>\n<p>El jugador "Amonestado/sancionado de oficio" NO INICIA EL PARTIDO CON UNA AMONESTACIÓN (Tarjeta Amarilla), sino que su sanción (Amonestación) por falta de canilleras, le será contabilizada en la acumulación personal de Tarjetas Amarillas y en lo grupal (equipo) en la tabla de Fair Play.\nUna vez iniciado el cotejo, los jugadores quedarán sujetos a los procedimientos y sanciones según reglamento gral de AFA.</p>\n\n\n<blockquote>Los encuentros se disputaran los días Sabados y feriados en los horarios de 12 45hs,14:10HS 15:30HS 16:45HS En caso de suspenderse fechas por razones meteorológicas la organización pasara el encuentro para el sabado proximo o en algunas ocasiones para el dia domingo.</blockquote>', '2013-04-30'),
(4, '<p><strong>Articulo 1:</strong> En los campeonatos podrán participar jugadores aficionados MAYORES de 16 (dieciséis) años.  Los menores de esa edad deberán presentar una autorización por sus padres o tutores.  Todos los jugadores deberán presentar D. N. I. para poder jugar.</p>\n\n<p><strong>Articulo 2:</strong> El complejo no se responsabiliza por las lesiones que los jugadores pudieran sufrir durante los encuentros, como así tampoco de las perdidas o sustracciones que puedan producirse dentro o fuera de la cancha, y/o del complejo.</p>\n\n<p><strong>Articulo 3:</strong> Los equipos participantes deberán presentar un listado de buena fe de 16 jugadores.  Dicha lista deberá contar con un maximo de 16 jugadoresy solamente se podran inscribir 3 jugadores libres por sabado.  Los jugadores que se reemplacen no podrán participar de lo que resta del torneo, ya sea para otro o si mismo equipo.  No podrán reemplazarse jugadores expulsados.</p>\n\n<p><strong>Articulo 4:</strong> Los equipos deberán ingresar al campo de juego con un mínimo de cinco (6) jugadores, pudiendo completar los nueve antes del inicio del complemento.  Podrán realizarse tres cambios.  Ingresaran al banco de suplentes todos los jugadores con su correspondiente camiseta sin importar el numero de ellos.  No se permitirá ingresar a ninguno de ellos sin camiseta.</p>\n\n<p><strong>Articulo 5:</strong> Los equipos ingresaran a la cancha correctamente vestidos.  Las camisetas, deben  estar en buenas condiciones, con números bien visibles en la parte posterior de la casaca.  El único habilitado a utilizar pantalones largos será el arquero, Los mismos no podrán utilizar remeras de equipos de fútbol que pertenezcan al profesionalismo.  El calzado podrá ser botines con tapones blandos o zapatillas, quedando totalmente prohibido utilizar botines con tapones de aluminio o descalzo.</p>\n\n<p><strong>Articulo 6:</strong> Los equipos deberán presentarse ante el planillero de cada cancha con sus camisetas numeradas y el documento que lo acredite y abonarle la suma de $, en concepto de arbitraje, asistencia medica y seguridad.</p>\n\n<p><strong>Articulo 7:</strong> En el caso de que dos equipos deban desempatar alguna ubicación en la tabla de posiciones, se empleara el siguiente criterio: Partido desempate este criterio solamente se usa en el primer puesto en los restantes posiciones se emplea la dif de goles.</p>\n\n<p><strong>Articulo 8:</strong> En el caso de que un equipo no se presente a jugar el resultado será de 0-2 en contra del equipo ínfractor.  El mismo podrá ser sancionado según la intencionalídad y debera abonar al proxima fecha el partido como si lo hubiese jugado.</p>\n\n<p><strong>Articulo 9:</strong> Los jugadores que deseen participar en algún equipo y hayan integrado alguna escuadra que mantenga deuda con el Organizador por cualquier concepto, al jugador le será cobrado, la fracción proporciona a la deuda de su equipo anterior.</p>\n\n<p><strong>Articulo 10:</strong> Bajo ningún concepto se permitirá a los jugadores el ingreso al campo de juego con un miembro enyesado o entablillado, reloj, anillo, pulsera, cadenas con medallas o cualquier otro elemento que ponga en riesgo la integridad física del adversario o compañero como así mismo.</p>\n\n<p><strong>Articulo 11:</strong> Para la disputa de los encuentros los delegados deberán llenar la planilla ante el planillero de la cancha que le corresponda jugar.</p>\n\n<p><strong>Articulo 12:</strong> Los árbitros serán las únicas autoridades del campo de juego. Sus decisiones serán irrevocables y solamente sobre la base de sus informes el tribunal de Disciplina aplicara las sanciones correspondientes.  Si por algún motivo el Tribunal de Disciplina no llegase a reunirse y a aplicar las sanciones que correspondan, los jugadores suspendidos no podrán ser de la partida siguiente a la de la expulsión . Los equipos a través de sus delegados tendrán el derecho de presentar un descargo.  El mismo se podrá efectivizar hasta cuarenta y ocho (48) después del partido.</p>\n\n<p><strong>Articulo 13:</strong> Queda totalmente prohibido el ingreso al campo de juego de un jugador reemplazado.  Si un jugador estuviera suspendido, cumpliendo una pena disciplinaria, y es participe en algún partido antes de que la sanción finalice, el equipo perderá los puntos en cuestión y el jugador será nuevamente sancionado.</p>\n\n<p><strong>Articulo 14:</strong> Los jugadores que sean sancionados con 4 amarillas cumpliran una  fecha de suspension.</p>\n\n<p><strong>Articulo 15:</strong> En al caso de agresión al arbitro o sus colaboradores por parte de los jugadores, D.T., delegados, colaboradores, simpatizantes, etc. El organizador apoyará al arbitro que desee presentar la correspondiente denuncia policial.  Asimismo serán sancionados con la máxima pena que el organizador pueda determinar.  El arbitro estará facultado para informar una hora antes y después de la hora de juego del partido que le toque arbitrar.</p>\n\n<p><strong>Articulo 16:</strong> Todos los equipos y/o instituciones participantes, están obligadas a respetar este reglamento, acatándolo en todos sus aspectos.  Aquellas situaciones no previstas en el mismo, se resolverán en reunión extraordinaria, donde se adoptaran las medidas adecuadas que amparen la buena imagen y correcto funcionamiento de la Organización.</p>\n\n<p><strong>Articulo 17:</strong> En el caso de haber jugadores, delgados o D.T. expulsados, los señores árbitros deberán presentar el día hábil después de cada jornada, un informe expresando los hechos y la causa que la motivó.</p>\n\n<p><strong>Articulo l8:</strong> Será inhabilitado: a) a quien permita la inclusión de un jugador no habilitado en un equipo de su dirección.  B) a quien provoque desorden por sus actitudes.  C) a quien ordene el retiro de la cancha del equipo que dirige o acepte el retiro dispuesto por el capitán del equipo.  D) a quien cometa tentativa de agresión, insulte o provoque a autoridades de la comisión Organizadora y/o Complejo Deportivo.</p>\n\n<p><strong>Articulo 19:</strong> Los organizadores junto con el Complejo Deportivo estarán facultades con el derecho de admisión de ingreso de equipos y/o jugadores al torneo.</p>\n\n<p><strong>Articulo 20:</strong> Este código será de aplicación obligatoria para los que directa o indirectamente integren el Torneo Jugadores, delegados, D.T., árbitros, Organizador, Complejo Deportivo, etc.).</p>\n\n<p><strong>Articulo 21:</strong> Cada equipo completara en la planilla antes del inicio de cada encuentro Nombre y Apellido, D.N.I., nro de camiseta para control, anotación de los goleadores, etc y deberan abonar la suma de $ p de no ser asi el equipo perdera automáticamente los puntos.</p>\n\n<p><strong>Articulo 22:</strong> La Organización se reserva el derecho de expulsar a un equipo por mal comportamiento, tanto dentro como fuera del campo de juego.</p>\n\n<p><strong>Articulo 23:</strong> Los Partidos se desarrollaran en dos tiempos de 30 minutos cada uno, sumado a lo que adicione el arbitro  y se jugara con un solo Futbol.</p>\n\n<p><strong>Articulo 24:</strong> Los equipos que no den aviso a la concurrencia de su partido perderan el deposito que equivale al valor de un partido, el mismo lo iran pagando en el transcurso de las fechas. </p>\n\n<p><strong>Articulo 25:</strong> El torneo se desarrollara de la siguiente manera por zonas de ascenso y descenso, o sea los equipos que continuen en nuestro torneo permaneceran en sus respectivas zonas en caso que halla equipos que abandonen el torneo automáticamente  ascenderan de zona, caso contrario los equipos nuevos ingresaran en la ultima zona y tendran que ir ascendiendo.En sistema es ascienden los primeros 3 de cada zona y descienden los ultimos 3.</p> \n\n \n\n \n\n\n\n\n<blockquote>Los encuentros se disputaran los días Sabados y feriados en los horarios de 12 45hs,14:10HS 15:30HS 16:45HS En caso de suspenderse fechas por razones meteorológicas la organización pasara el encuentro para el sabado proximo o en algunas ocasiones para el dia domingo.</blockquote>', '2014-03-14'),
