INSERT INTO `tbservicios` (`idservicios`, `planilleros`, `servmed`, `arbitraje`, `fechaactualizacion`) VALUES
(1, 'El torneo dispondrá de 15 planilleros, uno por cancha. Las funciones de los mismos serán:\n controlar la indumentaria y la identidad de cada jugador. \n Recibir la suma de $ de cada equipo antes que de comienzo el encuentro. \nInformar de toda inconducta que se produzca en su cancha por parte de jugadores, árbitros, publico, etc. \nProveer agua a todos los jugadores. \nAtender toda irregularidad que se presente en los partidos que haya sido asignado. \nDespejar toda duda que surja en cuanto a lo reglamentario.', 'Toda persona que se encuentre dentro del predio estará protegida por una ambulancia fija en el predio y por asistencia de medico fijo en el complejo. ', 'Los árbitros que intervienes en nuestros torneos son de: SADRA Y A.F.A. ', '2014-03-14');
INSERT INTO `tbservicios_bck` (`idservicios`, `planilleros`, `servmed`, `arbitraje`, `fechaactualizacion`) VALUES
